import Results from './Results';
import Add from './Add';
import style from '../style/App.module.css';

function Dashboard({ 
  token, 
  movimientos, 
  refreshKey, 
  onMovementUpdate, 
  movementToEdit, 
  setMovementToEdit, 
  ...authProps 
}) {
  return (
    <div className={style.contentSide}>
      <Results
        token={token}
        movimientos={movimientos}
        refreshKey={refreshKey}
        onEditClick={setMovementToEdit} // <-- Pasa la función para iniciar la edición
        onMovementUpdate={onMovementUpdate} // Pasa la función para refrescar
           setMovementToEdit={setMovementToEdit} 
        {...authProps}
      />
      <Add 
        onMovementAdded={onMovementUpdate} 
        movementToEdit={movementToEdit} // Pasa los datos para rellenar el formulario
      />
    </div>
  );
}

export default Dashboard;
